import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Boxoffice from './component/Basics/Boxoffice';
import Register from './component/Basics/Register';



export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Boxoffice />}><Route path="/Register" element={<Register />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
